PNTK_API int PNTK_init() {
  if (pntk_lib) {
    return PNTK_OK;
  }

#ifdef _WIN32
  char lib_path[MAX_PATH];
  GetModuleFileNameA(NULL, lib_path, MAX_PATH);
  char *last_slash = strrchr(lib_path, '\');
  if (last_slash) {
    *last_slash = '\0';
  }
  strcat(lib_path, ""\"" PNTK_LIB_NAME);
#else
  char lib_path[256];
  strcpy(lib_path, PNTK_LIB_NAME);
#endif

  pntk_lib = PNTK_LOAD_LIB(lib_path);
  if (!pntk_lib) {
    return PNTK_ERROR_LOAD_LIB;
  }

  PNTK_LOAD_PROC(pntk_lib, create);
  PNTK_LOAD_PROC(pntk_lib, destroy);
  PNTK_LOAD_PROC(pntk_lib, get_version);
  PNTK_LOAD_PROC(pntk_lib, get_error);
  PNTK_LOAD_PROC(pntk_lib, get_error_string);
  PNTK_LOAD_PROC(pntk_lib, get_last_error);
  PNTK_LOAD_PROC(pntk_lib, get_last_error_string);
  PNTK_LOAD_PROC(pntk_lib, get_param);
  PNTK_LOAD_PROC(pntk_lib, set_param);
  PNTK_LOAD_PROC(pntk_lib, get_param_count);
  PNTK_LOAD_PROC(pntk_lib, get_param_info);
  PNTK_LOAD_PROC(pntk_lib, get_param_info_by_index);
  PNTK_LOAD_PROC(pntk_lib, get_param_info_by_name);
  PNTK_LOAD_PROC(pntk_lib, get_input_count);
  PNTK_LOAD_PROC(pntk_lib, get_input_info);
  PNTK_LOAD_PROC(pntk_lib, get_input_info_by_index);
  PNTK_LOAD_PROC(pntk_lib, get_input_info_by_name);
  PNTK_LOAD_PROC(pntk_lib, get_output_count);
  PNTK_LOAD_PROC(pntk_lib, get_output_info);
  PNTK_LOAD_PROC(pntk_lib, get_output_info_by_index);
  PNTK_LOAD_PROC(pntk_lib, get_output_info_by_name);
  PNTK_LOAD_PROC(pntk_lib, get_input);
  PNTK_LOAD_PROC(pntk_lib, get_output);
  PNTK_LOAD_PROC(pntk_lib, set_input);
  PNTK_LOAD_PROC(pntk_lib, set_output);
  PNTK_LOAD_PROC(pntk_lib, run);

  return PNTK_OK;
}

